Machine language is just numbers in the memory:

\begin{V}
21 37 158 228 255 10 49 26 88 250 12 ...
\end{V}

Here is a simple algorithm to sort a list |a|:

\begin{V}
for i in range(len(a) - 1):
  for j in range(len(a) - 1):
    if a[j] > a[j+1]:
      a[j], a[j+1] = a[j+1], a[j]
\end{V}

My solution:

\begin{V}
def downup(w):
  print w
  if len(w) <= 1:
    return
  \dred@downup$(w[:-1])
  print w
\end{V}

The remaining digits are the representation of |n / b| in base |b|:

\begin{V}
def to_radix(n, b):
  if n < b:
    return str(n)
  s = to_radix(n / b, b)
  return s + str(n % b)
\end{V}

Merge Sort is an example of a more interesting recursive algorithm:  it uses \dred{two} recursive calls:

\begin{V}
def merge_sort(a):
  if len(a) <= 1:
    return
  m = len(a)/2
  a1 = a[:m]
  a2 = a[m:]
  merge_sort(a1)
  merge_sort(a2)
  merge(a, a1, a2)
\end{V}
